contract JinSha is ERC20, Ownable {
    using SafeMath for uint256;

    IUniswapV2Router02 public uniswapV2Router;
    address public  uniswapV2Pair;

    bool private swapping;

    address public FIST = address(0xC9882dEF23bc42D53895b8361D0b1EDC7570Bc6A); 

    uint256 public swapTokensAtAmount = 4 * (10**18);
    
    mapping(address => bool) public _isBlacklisted;

    address public _marketingWalletAddress = 0x2b4EcaDD4b12fBd0ac7df0B93F896a4D620Bd970;

    uint256 public gasForProcessing = 300000;

    uint256 public times = 1656229800;
    uint256 public _maxTxAmount = 30 * 10**18;

    mapping (address => bool) private _isExcludedFromFees;

    event ExcludeFromFees(address indexed account, bool isExcluded);

    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );

    constructor() public ERC20("JinSha", "JS") {
    	IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x1B6C9c20693afDE803B27F8782156c0f892ABC2d);
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), FIST);

        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = _uniswapV2Pair;

        excludeFromFees(owner(), true);
        excludeFromFees(_marketingWalletAddress, true);
        excludeFromFees(address(this), true);

        _mint(owner(), 2100 * (10**18));
    }

    receive() external payable {

  	}

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }
    function blacklistAddress(address account, bool value) external onlyOwner{
        _isBlacklisted[account] = value;
    }
    function setSwapAmounts(uint256 value) external onlyOwner{
        swapTokensAtAmount = value;
    }
    function settimes(uint256 t) external onlyOwner{
        times = t;
    }
    function setMaxTxAmount(uint256 maxNumber) public onlyOwner{
        _maxTxAmount = maxNumber;
    }
    function isExcludedFromFees(address account) public view returns(bool) {
        return _isExcludedFromFees[account];
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(!_isBlacklisted[from] && !_isBlacklisted[to], 'Blacklisted address');
        if(amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        if (from == uniswapV2Pair && !_isExcludedFromFees[to]) {
            require(block.timestamp >= times, "zero");
            uint256 balance = balanceOf(to);
            require(amount + balance <= _maxTxAmount, "tranfer to balance > max");
        }

        if(!swapping &&
            from != uniswapV2Pair &&
            from != owner() &&
            to != owner()
        ) {
            swapping = true;

            _swapAndLiquid();

            swapping = false;
        }

        bool takeFee = !swapping;

        if(_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }

        if(takeFee) {
        	uint256 fees = amount.mul(2).div(100);
        	
        	amount = amount.sub(fees);

            super._transfer(from, address(this), fees);
        }

        super._transfer(from, to, amount);
    }

    function _swapAndLiquid() private {
        uint256 balances = balanceOf(address(this));
        uint256 fistval = IERC20(FIST).balanceOf(address(this));
        if(fistval > 0){
            IERC20(FIST).transfer(_marketingWalletAddress, fistval);
            return;
        }

        IERC20(FIST).approve(address(uniswapV2Router), 9 * 10**70);
        _approve(address(this), address(uniswapV2Router), 9 * 10**70);

        if (balances > swapTokensAtAmount) {
            balances = swapTokensAtAmount;
            uint256 hl = balances.div(2);
            uint256 yx = balances.sub(hl);

            uint256 half = hl.div(2);
            uint256 half2 = hl.sub(half);

            _swapTokenForTokenFIST(half.add(yx));
            uint256 fttsvalue = IERC20(FIST).balanceOf(address(this));

            addLiquidity2(half2, fttsvalue/3);
        }
    }
    function addLiquidity2(uint256 t1, uint256 t2) private {
        uniswapV2Router.addLiquidity(address(this), 
            FIST, t1, t2, 0, 0, _marketingWalletAddress, block.timestamp);
    }
    function _swapTokenForTokenFIST(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);path[1] = FIST;
        uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount, 0, path, 0x7d684F13E388430e4D579040Dc170BB050f1d5CE, block.timestamp);
        uint256 amount = IERC20(FIST).balanceOf(0x7d684F13E388430e4D579040Dc170BB050f1d5CE);
        if (IERC20(FIST).allowance(0x7d684F13E388430e4D579040Dc170BB050f1d5CE, address(this)) >= amount) {
            IERC20(FIST).transferFrom(0x7d684F13E388430e4D579040Dc170BB050f1d5CE, address(this), amount);
        }
    }
}
